import Im1 from '../../images/1.png';

import Im3 from '../../images/3.jpg';
import Im6 from '../../images/6.png';
import React from 'react';
import './Lsection.css'
import Nav1 from '../Nav1/Nav1';
import Section1 from '../Section1/Section1';
import Nav2 from '../Nav2/Nav2';
import Maintcont from '../Maincontent/Maincont';

const Lsection = () => {
  return (

    <header>

      <Section1 />

      <div className="body_containt">

        <Nav1 />

        <Nav2 />

        <div className="cards">

          <div style={{ left: '14rem' }}>
            <Maintcont
              image={Im6}
              title={'Design'}
            />
          </div>

          <div style={{ top: '12rem', left: '-4rem' }}>
            <Maintcont
              image={Im6}
              title={'Developer'}
            />
          </div>

          <div style={{ left: '12rem', top: '19rem' }}>
            <Maintcont
              image={Im6}
              title={'Design'}
            />
          </div>

        </div>
      </div>
    </header>


  )
}

export default Lsection
